import React from 'react';
import data from './data.json'; // Assurez-vous que le chemin est correct

const ProjetData = () => {
  console.log(data); // Debug pour vérifier les données

  return (
    <div>
      <h1>Version: {data.version}</h1>
      <ul>
        {data.files.map((file, index) => (
          <li key={index}>
            <h2>Fichier {index + 1}: {file.label}</h2>
            <ul>
              {file.fields.map((field, fieldIndex) => (
                <li key={fieldIndex}>
                  <strong>{field.description}</strong> - Type: {field.type}, Cardinalité: {field.cardinality}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ProjetData;
